import React from 'react';
import ContentLoader from 'react-content-loader';

const ProfileLoader = (props) => (
  <ContentLoader
    speed={2}
    width={476}
    height={124}
    viewBox="0 0 476 124"
    backgroundColor="#a3a3a3"
    foregroundColor="#000000"
    {...props}
  >
    <rect x="341" y="36" rx="3" ry="3" width="106" height="15" />
    <rect x="340" y="86" rx="3" ry="3" width="130" height="14" />
    <circle cx="252" cy="67" r="52" />
    <rect x="554" y="176" rx="0" ry="0" width="35" height="33" />
  </ContentLoader>
);

export default ProfileLoader;
